# Create a complement table
firstString = "ACGT"
secondString = "TGCA"

DNA = ""
#print("Original DNA: %s" % DNA)

#Reversing symbols
reversedSequence=''.join(reversed(DNA))

translation = reversedSequence.maketrans(firstString, secondString)

# translate string
print("Complementing a Strand of DNA:", reversedSequence.translate(translation))


